function iconsBankColoredPaths(a) {
  let o = selection.icons,
    e = 1;
  return (
    o.forEach((o) => {
      let n = o.name;
      a.includes(n) && (e = o.paths);
    }),
    e
  );
}
function initIconsBankColored() {
  let a = document.querySelectorAll('i[class^="ib"]');
  for (let o = 0; o < a.length; o++) {
    let e = iconsBankColoredPaths(a[o].classList[1]);
    if (e > 1)
      for (let n = 1; n <= e; n++)
        a[o].innerHTML += `<i class="ib path${n}"></i>`;
  }
}
document.addEventListener("DOMContentLoaded", () => {
  initIconsBankColored();
});
